import React, { Component } from "react";
import axios from 'axios'


export default class labHome extends Component {

constructor(props){
  super(props);
this.state={
  lab:[]
};

}

  render() {
    return(
      <div className="container-fluid">

      <body style={{width:"100%",background:"#EDFFD9"}}>

      <div style={{textAlign:"center"}}>



      <br/><br/><br/><br/><br/><br/><br/><br/>

      <a className='btn btn-success' href='/labhome' ><i className='fas fa-vial'></i>&nbsp;Laboratory Management</a><br/><br/>

      <a className='btn btn-warning' href='/sechome' ><i className='fas fa-user-shield'></i>&nbsp;Security Management</a> <br/><br/>

      <a className='btn btn-danger' href='/abhome' ><i className='fas fa-ambulance'></i>&nbsp;Emergency Management</a><br/><br/>

      <a className='btn btn-warning' href='/eqhome' ><i className='fas fa-microscope'></i>&nbsp;Equipment Management</a><br/><br/>

      <a className='btn btn-success' href='/get' ><i className='fas fa-user-nurse'></i>&nbsp;Medical Staff Management</a>

      <br/><br/><br/><br/><br/><br/><br/><br/>

      <br/><br/><br/><br/><br/><br/><br/><br/>

      </div>

      </body>

      </div>
    )
  }
}
